import React from 'react';
import {withRouter} from 'react-router-dom';

const DepositWithdraw = (props) => {
	const { history } = props; 
	return (
		<div>
			<button className="button" onClick={() => history.push("/")}>Home</button>
			<button className="button" onClick={() => history.push("/resident")}>Soy un residente</button>
			<button className="button" onClick={() => history.push("/guest")}>Quiero pedir una invitaci√≥n</button>
			<button className="button" onClick={() => history.push("/depositWithdraw")}>Ingresar/Retirar</button>
		</div>
	);
}

export default DepositWithdraw;
